import React, { useState } from 'react';
import BSTMAIN from "./BSTMAIN";
import AVLTree from './AVL/avl';

function App()
{
    const [showbst, setShowbst] = useState(false);
    const [showavl, setShowavl] = useState(false);

    const handlebstclick = () => {
        setShowbst(true);
        setShowavl(false);
      };

      const handleavlclick = () => {
        setShowbst(false);
        setShowavl(true);
      };

    return(
        <div>
            <button onClick={handlebstclick}>BST</button>
        <button onClick={handleavlclick}>AVL</button>

        {showbst && <BSTMAIN />}
        {showavl && <AVLTree />}


        </div>
    )
}
export default App;
